package chap13.textbook.exercise.p03;

public class Container<K, V> {
	private K key;
	private V value;
	
	public void set(K key, V value) {
		// TODO Auto-generated method stub
		this.key = key;
		this.value = value;
	}

	public K getKey() {
		// TODO Auto-generated method stub
		return this.key;
	}

	public V getValue() {
		// TODO Auto-generated method stub
		return this.value;
	}
	

}
